VEAX91ldby&_nc_tp=18&oh=99eed3f1f98af2a24a1504111715c27a&oe=5F7C136D";}i:112;a:1:{s:4:"type";s:5:"image";}i:113;a:1:{s:8:"owner_id";i:1470112141;}i:114;a:1:{s:14:"owner_username";s:0:"";}i:115;a:1:{s:14:"owner_fullname";s:0:"";}i:116;a:1:{s:9:"owner_pic";s:0:"";}i:117;a:1:{s:2:"id";s:19:"2390942400589971423";}i:118;a:1:{s:10:"short_code";s:11:"CEuVXIRlb_f";}i:119;a:1:{s:12:"created_time";i:1599242566;}i:120;a:1:{s:7:"caption";s:2240:"당신은 밤에도 불을 켜고 웅크렸다. 나는 낮에도 커튼을 치고 책을 읽었다. 당신은 빛을 쫓는 자신이 가로등으로 날아드는 나방 같다고 했고, 나는 살고 싶으면 어두운 쪽으로 오라며 주머니를 가리키곤 했다. 우리가 죽은 뒤 자연으로 환원되면  당신과 나의 영체만으로 낮과 밤이겠다던 그 말을 지금도 좋아하고 있다. 

주머니 하나에 두 손이 엉겨 붙어 정말 하나인 줄 알고 깔깔거렸던 날들이 눈에 선하다. 지금도 가끔은 불을 꼈다 켰다 하듯 지치는 일상 속에 그런 단편들이 모여 반짝반짝 빛이 난다. 우린 함께여서 편하게 읽히는 문장이었지만, 사실은 손을 잡아도 상반된 단어였다. 이따금 사색에 빠져 내면을 거닐 때면, 밟히는 추억의 부스러기가 작은 모래사장 같다. 간혹 유리 조각이 섞여 있다 해도, 조금 더 걸었으면 좋았을 해변이니 괜찮을 것이다. 

밝지도 어둡지도 않은 뿌연 새벽의 한가운데서, 부둥켜안고 속삭이던 귓속말은 우리만 아는 휘파람이 됐다. 해돋이로부터 날아든 노란 뱀들이 창을 넘어 우릴 향해 곧게 쏟아지면, 빛에 물린 서로의 면면을 목도하는 동안에 충만해진 네 개의 눈동자를 기억한다. 저 바다가 전부 당신과 나의 땀이나 눈물이라면, 우리가 분 휘파람은 실재해서 애틋한 가락이겠다. 

먼저 죽은 어떤 연인들의 낮과 밤을 빌려 쓴다고 생각하면 어쩐지 서글퍼진다. 언젠가 당신과 갚아나갈 거로 생각했지만, 이제는 어려운 일이 됐다. 무섭지도 않은데 괜히 불을 켜고 웅크리는 것은 당신이란 그리움을 대하는 단순한 대처이지만, 이런 밤이 잦아지면 항구적인 잠 습관으로 남을 수도 있겠다. 이따금 주머니에 손을 넣었을 때 모래 알갱이 같은 게 만져지면, 강 너머를 보기 위해 잠시 커튼을 걷어 젖힌다. 내가 잘 아는 빛이 방 안으로 파고들면, 낮과 밤이나 빛과 어둠 같은 단어들을 떠올리다가 당신과 나의 이름을 차례로 발음해보기도 하는 것이다.";}i:121;a:1:{s:14:"comments_count";i:1;}i:122;a:1:{s:11:"likes_count";i:8;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuVXIRlb_f";}i:124;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118824170_2994117020716152_4190981914137299220_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=KQHpc6ghUZMAX93Z24y&_nc_tp=18&oh=78b917ca2b7865210f871f675916c4a3&oe=5F7C2DE5";}i:125;a:1:{s:4:"type";s:5:"image";}i:126;a:1:{s:8:"owner_id";i:3664051361;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2390942187535547433";}i:131;a:1:{s:10:"short_code";s:11:"CEuVUB2jTwp";}i:132;a:1:{s:12:"created_time";i:1599242541;}i:133;a:1:{s:7:"caption";s:18:"✈️🛫🛬🛩";}i:134;a:1:{s:14:"comments_count";i:3;}i:135;a:1:{s:11:"likes_count";i:13;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuVUB2jTwp";}i:137;a:1:{s:5:"image";s:246:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118808717_674072453209065_46551801177380023_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=Ap4OcTExIfoAX-vB7oy&_nc_tp=18&oh=1e461eaa343e57ee28bb0cd469588e67&oe=5F7A7D2E";}i:138;a:1:{s:4:"type";s:5:"image";}i:139;a:1:{s:8:"owner_id";i:6326104555;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2390942101311569882";}i:144;a:1:{s:10:"short_code";s:11:"CEuVSxjM7_a";}i:145;a:1:{s:12:"created_time";i:1599242530;}i:146;a:1:{s:7:"caption";s:384:"오늘은  공룡이  태양을 잡아먹을듯한
